import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
            <h1 className="text-4xl font-bold mb-8 text-gray-800">Administración de Productos</h1>
            <div className="space-x-4">
                <Link to="/products" className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
                    Ver Productos
                </Link>
                <Link to="/add-product" className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600">
                    Agregar Producto
                </Link>
                <Link to="/clients" className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600">
                    Gestión de Clientes
                </Link>
            </div>
        </div>
    );
};

export default HomePage;
